import React from "react";
import store from "../store";

let employees = [
  {
    id: 1,
    firstName: "John",
    lastName: "Doe",
    age: 27,
    joinedDate: "December 15, 2017",
  },

  {
    id: 2,
    firstName: "Ana",
    lastName: "Rosy",
    age: 25,
    joinedDate: "January 15, 2019",
  },

  {
    id: 3,
    firstName: "Zion",
    lastName: "Albert",
    age: 30,
    joinedDate: "February 15, 2011",
  },
];

const employeesItems = employees.map((item) => (
  <li key={item.id}>
    {item.firstName}, {item.age}
  </li>
));

